import './App.css';
import Navbar from "./Components/Navbar";
import Section from "./Components/Section";
import dummyText from "./DummyText";
import About from "./Components/About"
import Resume from "./Components/Resume"

function App() {
  const [aboutFocus, setAboutFocus] = useState(true)
  return (
    <div className="App">
      <Navbar aboutFocus={(e) => {setAboutFocus(e)}} />
      <Section
        content = {About(aboutFocus)}
        dark={false}
        id="section1"
      />
      <Section
        content = {Resume(resumeFocus)}
        dark={true}
        id="section2"
      />
      <Section
        content = {dummyText}
        dark={false}
        id="section3"
      />
    </div>
  );
}

export default App;
